        <h1>
          <span className="title-1">What is JWST?</span>
        </h1>
        <p className="desc-1">
          JWST is a space telescope that will study the universe in infrared light.
          It will be able to see through the dust and gas that blocks our view of
          the universe in visible light. It will also be able to see the first
          galaxies that formed after the Big Bang. JWST will be launched in 2021.
        </p>
      </div>

      <div className="section-1">
        
      </div>

      <div className="section-1">

      </div>
    </div>
  );
}
export default Home;
